#include <iostream>
#include <string>

using namespace std;

bool canConstruct(string ransomNote, string magazine)
{
    int dic1[26] = {0};

    for (char c : magazine)
    {
        dic1[c - 'a']++;
    }

    for(char c : ransomNote)
    {
        if (dic1[c - 'a'] == 0)
        {
            return false;
        }

        dic1[c - 'a']--;
    }

    return true;
}

int main()
{
    cout << canConstruct("aa", "aab") << " Expected: 1" << endl;
    cout << canConstruct("aa", "a") << " Expected: 0" << endl;
    cout << canConstruct("b", "a") << " Expected: 0" << endl;
    cout << canConstruct("fffbfg","effjfggbffjdgbjjhhdegh") << " Expected: 1" << endl;

    cout << canConstruct("",
"") << " Expected: 0" << endl;
}
